// hmtar en referens till projektet
def project = testRunner.testCase.testSuite.project

def oldClassLoader = Thread.currentThread().getContextClassLoader() 
try {
	// skapar en ny classLoader s att soapui hittar vra test klasser
	def folder = new File(project.context.expand('${projectDir}'))
	def classLoader = new groovy.lang.GroovyClassLoader(this.class.classLoader);
	classLoader.addURL(folder.toURI().toURL())
	folder.listFiles().each {file ->
	    if (file.name.endsWith('.jar')) {
	        classLoader.addURL(file.toURI().toURL())
	    }
	}
	Thread.currentThread().setContextClassLoader(classLoader) 

	// definierar i context vilken milj vi ska kra mot
	project.context.environ = project.getPropertyValue('Environ')

	// initierar felrknaren
	project.context.failureCount = 0

	// exekverar testet
	classLoader.findClass('se.sbab.testcenter.is.SBABExecutor').newInstance().execute(project, project.context.testCases, log)

} catch (Throwable e) {
	log.error(e) 
}
Thread.currentThread().setContextClassLoader(oldClassLoader) 

// verifierar att inget har misslyckats
assert project.context.failureCount.equals(0)

