declare namespace soap='http://schemas.xmlsoap.org/soap/envelope/';
declare namespace ns1='java:se.sbab.lar.vo.v5';
declare namespace ns2='http://lanarende.sbab.se';

//soap:Envelope/soap:Body/ns2:skapaLanelofteResponse/ns2:SkapaLanelofteSvar/ns1:Sbabid

con:config.script:
import groovy.util.XmlParser
import se.sbab.testdata.dao.lanarende.*

def skapaLanansokan = testRunner.testCase.getTestStepByName("skapaLanelofte")
def soapResponse = skapaLanansokan.getProperty("Response").value 
def response = new XmlParser(false,false).parseText(soapResponse)
def parameters = response["env:Body"] ["m:skapaLanelofteResponse"] ["m:SkapaLanelofteSvar"] ["java:Sbabid"] 
def workspace = com.eviware.soapui.SoapUI.getWorkspace();
def testSuite = workspace.getProjectByName("Partner").getTestSuiteByName("Generic");
def ctx = testRunner.testCase.testSuite.project.context
def sbabid = ''
parameters.each{
	context.sbabid = it.value()[0]
} 
testRunner.testCase.testSuite.setPropertyValue('sbabid',context.sbabid)

def kreid = ctx.arendeDao.findBySQLQuery('select kreid from arende where sbabid =\''+context.sbabid+'\'')
testSuite.setPropertyValue('kreid', kreid[0].toString());
assert kreid[0] !=0
log.info "Assert kreid not zero: "+kreid
assert context.sbabid !=0
log.info "Assert sbabid not zero: "+context.sbabid

